import React from "react";
import Header from './Header';
import CreateNote from './CreateNote';
import Note from './Note';
import footer from './footer';


const Goo =()=>
{

    return(
      <>
      <Header/>
      <CreateNote/>
      <Note/>
      <footer/>
      </>
    );
};

export default Goo;
